import React from 'react';

class LoginMenu extends React.Component {
    constructor(props) {
        super(props);
    }


    render() {

        return <div className="CreateAccountBtn MenuBtn" onClick={this.props.handleAppStateChange('CreateAccount')}> Create Account </div>;
    }
}

export default LoginMenu;
